import React from 'react';
import {Link} from 'react-router-dom';

function NavBar(){
    const [isOpen, setIsOpen] = React.useState(false);


    return(
        <div className="fixed t-0 l-0 flex flex-row-reverse">
            <div classname="flex">
                Navbar
            </div>
            <div className={`${isOpen ? "h-[13vh] w-[100vw] [transition:height_300ms_0ms]" : "h-[0vh] w-[0vw] [transition:width_200ms_300ms,height_300ms_0ms]"} bg-gray-300 border-t border-black overflow-hidden`}>
                <ul>
                    <li><Link to="/">Home</Link></li>
                    <li><Link to="/YouTubeAPI">YouTube API</Link></li>
                    <li><Link to="/SpotifyAPI">Spotify API</Link></li>
                    <li><Link to="/Databases">Database</Link></li>
                    <li><Link to="/Contact">Contact</Link></li>
                </ul>
            </div>
        </div>
    );
}

export default NavBar;
